hadoop-mapreduce-project/hadoop-mapreduce-client/hadoop-mapreduce-client-core in trunk has 3 extant Findbugs warnings.
hadoop-mapreduce-project/hadoop-mapreduce-client/hadoop-mapreduce-client-app in trunk has 3 extant Findbugs warnings.
hadoop-mapreduce-project/hadoop-mapreduce-client/hadoop-mapreduce-client-hs in trunk has 1 extant Findbugs warnings.
hadoop-mapreduce-project/hadoop-mapreduce-examples in trunk has 1 extant Findbugs warnings.
{noformat}

submit v1 patch to fix.

Thank [~cheersyang] for providing the patches.
{code}
    if (curLocalFiles != null) {
      HashSet<File> lf = new HashSet<File>(curLocalFiles.length);
      for (int j = 0; j < curLocalFiles.length; ++j) {
        lf.add(curLocalFiles[j]);
      }
      localizedFiles = Collections.unmodifiableSet(lf);
    }
{code}
If curLocalFiles is null, localizedFiles is not initialized, and then, {{relocalize()}} method calls {{!localizedFiles.contains(curLocalFiles\[j\])}} and it causes NPE. What do you think?
{code}
      for (int j = 0; j < curLocalFiles.length; ++j) {
        lf.add(curLocalFiles[j]);
      }
{code}
{{Collections.addAll(lf, curLocalFiles)}} can be used instead.
